import React, { useState } from 'react';
import { Box, Typography, Grid, Card, CardContent, Button, CardMedia, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle } from '@mui/material';

const Courses = () => {
    const predefinedCourses = [
        { courseName: "C++", credits: 5, img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSClQ_Loejuhs7NV2jYD7O3Vnd_-wNZT57T5w&s" },
        { courseName: "Java", credits: 4, img: "data:image/jpeg;base64," },
        { courseName: "SQL", credits: 3, img: "data:image/jpeg;base64," },
        { courseName: "Python", credits: 4, img: "data:image/jpeg;base64," },
        { courseName: "React", credits: 3, img: "data:image/jpeg;base64," },
        { courseName: "JavaScript", credits: 3, img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRx2zuN3YyGv_TJ98Q6-6pVFjY1ARQD6f_EMg&s" },
        { courseName: "Ruby", credits: 4, img: "data:image/jpeg;base64," },
        { courseName: "BlockChain", credits: 3, img: "data:image/jpeg;base64," },
        { courseName: "Robotics", credits: 4, img: "data:image/jpeg;base64," },
        { courseName: "Perl", credits: 3, img: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR3BMpsy2Rm_LHffLook0SLtdaS2HZ1UORN1w&s" },
        { courseName: "CloudComputing", credits: 4, img: "data:image/jpeg;base64," },
        { courseName: "AIML", credits: 3, img: "data:image/jpeg;base64," },
    ];

    const [open, setOpen] = useState(false);
    const [selectedCourse, setSelectedCourse] = useState(null);

    const handleClickOpen = (course) => {
        setSelectedCourse(course);
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <Box 
            mt={5} 
            textAlign="center"
            sx={{ bgcolor: '#f9fafc', p: 3, borderRadius: 2, boxShadow: 3, maxWidth: 1200, mx: 'auto' }}
        >
            <Typography variant="h4" mb={3} fontWeight="bold">Explore Live Classes</Typography>
            <Grid container spacing={3} justifyContent="center">
                {predefinedCourses.map((course, index) => (
                    <Grid item xs={12} sm={6} md={4} key={index}>
                        <Card sx={{ maxWidth: 345 }}>
                            <CardMedia
                                component="img"
                                height="140"
                                image={course.img}
                                alt={`${course.courseName} image`}
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h5" component="div">
                                    {course.courseName}
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    Credits: {course.credits}
                                </Typography>
                            </CardContent>
                            <Box textAlign="center" sx={{ p: 2 }}>
                                <Button variant="contained" color="primary" onClick={() => handleClickOpen(course)}>
                                    Enroll
                                </Button>
                            </Box>
                        </Card>
                    </Grid>
                ))}
            </Grid>

            <Dialog open={open} onClose={handleClose}>
                <DialogTitle>{selectedCourse?.courseName} Enroll Confirmation</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        Are you sure you want to enroll in {selectedCourse?.courseName} with {selectedCourse?.credits} credits?
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose} color="primary">
                        Cancel
                    </Button>
                    <Button onClick={handleClose} color="primary" autoFocus>
                        Confirm
                    </Button>
                </DialogActions>
            </Dialog>
        </Box>
    );
};

export default Courses;
